    function run() : void {
        $headers = require 'data/product_input_headers.php';
        ProductInputHeader::factory()->createMany($headers);

        $inputs = require 'data/product_inputs.php';
        ProductInput::factory()->createMany($inputs);
    }


    public function createProductInput(array $data): void
    {

        $header = ProductInputHeader::factory()->create([
            'bill_number' => $data['bill_number']
        ]);
        foreach ($data['data'] as $item) {

            $header->items()->create([
                'product_id' => $item['product_id'],
                'quantity' => $item['qt'],
                'unit_cost_price' => $item['u_cost'],
                'total_cost_price' => $item['u_cost'] * $item['qt'],
                'expire_date' => trim($item['ex'] ?? ' '),
                'payment_type' => PaymentType::cash,
//                'bill_number'=>$item['bill_number']

            ]);
        }
    }
